import React from 'react'
import './UploadedFile.css'

class UploadedFile extends React.Component {
    render() {
        return (
            <div>
                <div><a className='uploadedFile'>Загруженный файл</a></div>
                <div><a className='uploadedFile'>Большоей загруженный файл</a></div>
            </div>
        ) 
    }
}

export default UploadedFile
